from typing import List
class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        ''' for each unique digit, find the first two index locations'''
        u_digit_places = {}
        for x in range(numbers[0],numbers[-1]+1):
            if numbers.count(x) >= 1: # record first value and location
                u_digit_places[x] = [numbers.index(x)]
            if numbers.count(x) >= 2: # record second location in a list like 3:[2,5]
                u_digit_places[x] = [numbers.index(x),numbers.index(x,u_digit_places[x][0])+1]
                
        'loop over each key in created dict,try each combo'
        for y in u_digit_places.keys():  
            for z in u_digit_places.keys():
                if y + z == target:
                    if y == z :  # if same digit, special return type
                        if len(u_digit_places[y]) > 1:
                            return [u_digit_places[y][0]+1,u_digit_places[y][1]+1]
                    return [u_digit_places[y][0]+1,u_digit_places[z][0]+1]
                
    def twoSum2(self, numbers: List[int], target: int) -> List[int]:
        ''' works but slow'''
        for x in range(len(numbers)):
            for y in range(x+1,len(numbers)):
                if numbers[x] + numbers[y] == target:
                    return [x+1,y+1]
                if numbers[x] + numbers[y] > target:
                    break                
                
    def twoSum3(self, numbers: List[int], target: int) -> List[int]:
        ''' much cleaner online solution'''
        N = len(numbers)
        lookup = {}
        
        for i in range(N):
            other_num = target - numbers[i]
			
            if other_num not in lookup:
                lookup[numbers[i]] = i
            else:
                return [lookup[other_num]+1,i+1]



                
